// src/components/Footer.js
import React from 'react';

const Footer = () => {
  return (
    <footer className="footer">
      <p>&copy; 2024 E-Library. All rights reserved.</p>
      <a href="/privacy">Privacy Policy</a> | <a href="/terms">Terms of Service</a>
    </footer>
  );
};

export default Footer;
